import '../App.css';
import React, {Component} from 'react'
import axios from 'axios'
import 'w3-css/w3.css';

export default class GetComp extends Component {
  state = {
    persons: []
  }

  componentDidMount() {
    axios.get('http://localhost:8080/api/projects')
      .then(res => {
        const persons = res.data;
        this.setState({ persons });
      })
  }

  render() {
    return (
      <ul>
        { this.state.persons.map(person => 
        
        <div className=" w3-round "  >
			  
        <div  className="w3-cell-row w3-container w3-white" style={{width:"311px",paddingBottom:"8px"}}>
    
         <div className="w3-cell ">
           <p>{person.name} </p>
         </div>
         <button className="w3-button w3-red w3-round-large">Add User</button>
         
       </div>
   </div>)}


     
   
       

      </ul>
    )
  }
}
